valid'=>'Nummerformatet som avsändaren angav är ogiltigt','This contact form has file uploading fields, but the temporary folder for the files (%s) does not exist or is not writable. You can create the folder or change its permission manually.'=>'Detta kontaktformulär har fält för filuppladdning, men den temporära mappen för filerna (%s) finns inte eller är inte skrivbar. Du kan skapa mappen eller ändra dess behörighet manuellt.','Acceptable file types'=>'Acceptabla filtyper','file'=>'fil','Uploading a file fails for PHP error'=>'Uppladdningen av en fil misslyckades på grund av PHP-fel','Uploaded file is too large'=>'Den uppladdade filen är för stor','Uploaded file is not allowed for file type'=>'Uppladdad fil är inte tillåten för filtyp','Uploading a file fails for any reason'=>'Filuppladdningen misslyckas av någon anledning','Max'=>'Max','Min'=>'Min','Range'=>'Intervall','Default value'=>'Standardvärde','Date field'=>'Datumfält','date'=>'datum','Date is later than maximum limit'=>'Datum är senare än tillåtet','Date is earlier than minimum limit'=>'Datumet är tidigare än tillåtet','Date format that the sender entered is invalid'=>'Datumformatet avsändaren använt är ogiltigt','Field type'=>'Fälttyp','radio buttons'=>'radioknappar','checkboxes'=>'kryssrutor','This contact form contains CAPTCHA fields, but the necessary libraries (GD and FreeType) are not available on your server.'=>'Det här kontaktformuläret innehåller CAPTCHA, men de nödvändiga biblioteken (GD och FreeType) saknas på din server.','This contact form contains CAPTCHA fields, but the temporary folder for the files (%s) does not exist or is not writable. You can create the folder or change its permission manually.'=>'Det här kontaktformuläret innehåller CAPTCHA, men den temporära mappen för filerna (%s) existerar inte eller är inte skrivbar. Du kan skapa mappen eller ändra mappens rättigheter manuellt.','Your entered code is incorrect.'=>'Koden du angav är felaktig.','The code that sender entered does not match the CAPTCHA'=>'Koden användare anger matchar inte CAPTCHA-koden','Insert Tag'=>'Infoga etikett','Class attribute'=>'Class-attribut','ID attribute'=>'ID-attribut','Acceptance checkbox'=>'Kryssruta för godkännande','acceptance'=>'godkännande','<code>%1$s</code> property of a <code>WPCF7_ContactForm</code> object is <strong>no longer accessible</strong>. Use <code>%2$s</code> method instead.'=>'<code>%1$s</code> property of a <code>WPCF7_ContactForm</code> object is <strong>no longer accessible</strong>. Use <code>%2$s</code> method instead.','Untitled'=>'Namnlös','Contact Form'=>'Kontaktformulär','There is a field with input that is shorter than the minimum allowed length'=>'Ett fält har kortare innehåll än tillåtet','There is a field with input that is longer than the maximum allowed length'=>'Ett fält har längre innehåll än tillåtet','There is a field that the sender must fill in'=>'Det finns ett fält som användaren måste fylla i','There are terms that the sender must accept'=>'Det finns villkor som avsändaren måste acceptera','Submission was referred to as spam'=>'Meddelandet markerades som skräppost','Validation errors occurred'=>'Valideringsfel uppstod','Sender&#8217;s message was sent successfully'=>'Avsändarens meddelande skickades','Message Body:'=>'Meddelandets innehåll:','Subject: %s'=>'Ämne: %s','From: %s'=>'Från: %s','Send'=>'Skicka','Your message'=>'Ditt meddelande','Your email'=>'Din e-post','Your name'=>'Ditt namn','Form-tag Generator: %s'=>'Formulär-taggsgenerator: %s','For more information:'=>'För mer information:','Any information you provide will not be shared with service providers without your authorization.'=>'Ingen information du lämnar kommer att delas med tjänsteleverantörer utan ditt tillstånd.','You may need to first sign up for an account with the service that you plan to use. When you do so, you would need to authorize Contact Form 7 to access the service with your account.'=>'Du kan först behöva registrera dig för ett konto hos den tjänst du tänker använda. När du gör det måste du godkänna att Contact Form 7 får tillgång till tjänsten via ditt konto.','On this screen, you can manage services that are available through Contact Form 7. Using API will allow you to collaborate with any services that are available.'=>'På denna skärm kan du hantera tjänster som är tillgängliga via Contact Form 7. Tack vare API:et kan du samarbeta med alla tillgängliga tjänster.','There are also special mail-tags that have specific names, but do not have corresponding form-tags. They are used to represent meta information of form submissions like the submitter&#8217;s IP address or the URL of the page.'=>'Det finns också speciella e-posttaggar med namn som inte har motsvarande formulär-taggar. De används för meta-information från när formuläret skickades, som avsändarens IP-adress eller formulärsidans URL.','A mail-tag is also a short code enclosed in square brackets that you can use in every Mail and Mail (2) field. A mail-tag represents a user input value through an input field of a corresponding form-tag.'=>'En e-posttagg är även en kortkod omringad av hakparanteser som du kan använda i alla fält under E-post- och E-post (2). En e-posttagg representerar det värde som användaren angett i ett inmatningsfält i motsvarande formulärtagg.','While form-tags have a comparatively complex syntax, you do not need to know the syntax to add form-tags because you can use the straightforward tag generator (<strong>Generate Tag</strong> button on this screen).'=>'Även om formulär-taggar är relativt komplicerade, behöver du inte kunna syntaxen eftersom det finns en tagg-generator som är enkel att använda (knappen <strong>Skapa tagg</strong> på den här sidan).','A form-tag is a short code enclosed in square brackets used in a form content. A form-tag generally represents an input field, and its components can be separated into four parts: type, name, options, and values. Contact Form 7 supports several types of form-tags including text fields, number fields, date fields, checkboxes, radio buttons, menus, file-uploading fields, CAPTCHAs, and quiz fields.'=>'Formulär-taggar är kod innesluten i hakparanteser som används i ett formulär. Formulär-taggar motsvarar ett inmatningsfält vars innehåll kan delas i fyra delar: typ, namn, alternativ och värden (type, name, options, and values). Contact Form 7 stöder olika typer av formulär-taggar som text-fält, nummer-fält, datum-fält, kryssrutor, radio-knappar, menyer, filuppladdning, CAPTCHA och quiz-fält.','<strong>Additional Settings</strong> provides a place where you can customize the behavior of this contact form by adding code snippets.'=>'I <strong>Avancerade inställningar</strong> kan du ytterligare anpassa kontaktformuläret genom att lägga till egen kod.','In <strong>Messages</strong>, you can edit various types of messages used for this contact form. These messages are relatively short messages, like a validation error message you see when you leave a required field blank.'=>'I <strong>Meddelande</strong> kan du ändra olika typer av meddelanden som används för kontaktformuläret. Dessa meddelanden är relativt korta, som ett meddelande om valideringsfel som visas när ett obligatoriskt fält lämnas tomt.','<strong>Mail (2)</strong> is an additional mail template that works similar to Mail. Mail (2) is different in that it is sent only when Mail has been sent successfully.'=>'<strong>E-post (2)</strong> är en extra e-postmall som fungerar på liknande sätt som E-post. E-post (2) skickas endast om det gick bra att skicka det första e-postmeddelandet.','<strong>Mail</strong> manages a mail template (headers and message body) that this contact form will send when users submit it. You can use Contact Form 7&#8217;s mail-tags here.'=>'<strong>E-post</strong> hanterar en e-postmall (sidhuvuden och meddelandekropp) som det här kontaktformuläret sänder när någon skickar in formuläret. Här kan du använda e-posttaggarna i Contact Form 7.','<strong>Form</strong> is a content of HTML form. You can use arbitrary HTML, which is allowed inside a form element. You can also use Contact Form 7&#8217;s form-tags here.'=>'<strong>Formulär</strong> är innehållet i ett HTML form. Du kan använda valfri HTML, som tillåts i ett form-element. Du kan också använda Contact Form 7&#8217;s form-taggar här.','<strong>Title</strong> is the title of a contact form. This title is only used for labeling a contact form, and can be edited.'=>'<strong>Rubrik</strong> är rubriken för ett kontaktformulär. Denna rubrik används endast för att märka ett kontaktformulär och kan redigeras.','On this screen, you can edit a contact form. A contact form is comprised of the following components:'=>'På den här sidan kan du redigera ett kontaktformulär. Kontaktformulär består av följande delar:','<strong>Duplicate</strong> - Clones that contact form. A cloned contact form inherits all content from the original, but has a different ID.'=>'<strong>Duplicera</strong> - Duplicerar kontaktformuläret. Ett duplicerat kontaktformulär innehåller allt från originalet men har ett annat ID.','<strong>Edit</strong> - Navigates to the editing screen for that contact form. You can also reach that screen by clicking on the contact form title.'=>'<strong>Redigera</strong> - Öppnar sidan för redigering av kontaktformuläret. Du kan också öppna det genom att klicka på kontaktformulärets titel.','Hovering over a row in the contact forms list will display action links that allow you to manage your contact form. You can perform the following actions:'=>'Hovra över en rad i listan med kontaktformulär så visas länkar till åtgärder som du kan använda. Du kan använda följande åtgärder:','On this screen, you can manage contact forms provided by Contact Form 7. You can manage an unlimited number of contact forms. Each contact form has a unique ID and Contact Form 7 shortcode ([contact-form-7 ...]). To insert a contact form into a post or a text widget, insert the shortcode into the target.'=>'Här kan du hantera kontaktformulär som skapats med Contact Form 7. Du kan hantera ett obegränsat antal kontaktformulär. Varje kontaktformulär har ett unikt ID och en Contact Form 7 shortcode ([contact-form-7 ...]). Infoga ett kontaktformulär genom att klistra in shortcode i ett inlägg eller en text-widget.','Mail-tags'=>'E-posttaggar','Form-tags'=>'Formulär-taggar','Available Actions'=>'Tillgängliga åtgärder','Overview'=>'Översikt','You can add customization code snippets here. For details, see %s.'=>'Du kan lägga till anpassad kod här. Mer information finns i %s.','https://contactform7.com/additional-settings/'=>'https://contactform7.com/additional-settings/','File attachments'=>'Filbilagor','Use HTML content type'=>'Använd HTML-innehåll','Exclude lines with blank mail-tags from output'=>'Exkludera rader med tomma e-posttaggar i utdata','Message body'=>'Meddelandets innehåll','Additional headers'=>'Ytterligare rubriker','Subject'=>'Ämne','From'=>'Från','To'=>'Till','In the following fields, you can use these mail-tags:'=>'I nedanstående fält kan du använda följande e-posttaggar:','Mail (2) is an additional mail template often used as an autoresponder.'=>'E-post (2) är en ytterligare e-postmall som ofta används för autosvar.','Use Mail (2)'=>'Använd e-post (2)','Mail (2)'=>'E-post (2)','Y/m/d'=>'Y-m-d','Edit &#8220;%s&#8221;'=>'Redigera ”%s”','Edit'=>'Redigera','Date'=>'Datum','Author'=>'Författare','Shortcode'=>'Kortkod','Title'=>'Rubrik','Additional Settings'=>'Ytterligare inställningar','Additional Settings (%d)'=>'Ytterligare inställningar (%d)','Messages'=>'Meddelanden','Mail'=>'E-post','Form'=>'Formulär','Support'=>'Support','https://contactform7.com/support/'=>'https://contactform7.com/support/','FAQ'=>'Vanliga frågor','https://contactform7.com/faq/'=>'https://contactform7.com/faq/','Docs'=>'Dokumentation','https://contactform7.com/docs/'=>'https://contactform7.com/docs/','Delete'=>'Ta bort','Duplicate'=>'Duplicera','Status'=>'Status','You can also use this old-style shortcode:'=>'Du kan också använda denna äldre kortkod:','Copy this shortcode and paste it into your post, page, or text widget content:'=>'Kopiera denna kortkod och klistra in den i ditt inlägg, sida eller textwidgetinnehåll:','Enter title here'=>'Ange rubrik här','Save'=>'Spara','You are not allowed to edit this contact form.'=>'Du har inte behörighet att redigera detta kontaktformulär.','https://contactform7.com/save-submitted-messages-with-flamingo/'=>'https://contactform7.com/save-submitted-messages-with-flamingo/','Spam filtering with Akismet'=>'Skräppostfiltrering med Akismet','https://contactform7.com/spam-filtering-with-akismet/'=>'https://contactform7.com/spam-filtering-with-akismet/','Setting up mail'=>'Ställer in e-post','https://contactform7.com/setting-up-mail/'=>'https://contactform7.com/setting-up-mail/','Contact Form 7 needs your support.'=>'Contact Form 7 behöver ditt stöd.','Dismiss'=>'Avfärda','<strong>Contact Form 7 %1$s requires WordPress %2$s or higher.</strong> Please <a href="%3$s">update WordPress</a> first.'=>'<strong>Contact Form 7 %1$s kräver WordPress %2$s eller senare.</strong> <a href="%3$s">Uppdatera WordPress</a> först.','Settings'=>'Inställningar','Contact form deleted.'=>'Kontaktformulär borttaget.','Contact form saved.'=>'Kontaktformulär sparat.','Contact form created.'=>'Kontaktformulär skapat.','Search Contact Forms'=>'Sök kontaktformulär','Error in deleting.'=>'Fel vid borttagning.','You are not allowed to delete this item.'=>'Du har inte behörighet att ta bort detta objekt.','You are not allowed to edit this item.'=>'Du har inte behörighet att redigera detta objekt.','Integration'=>'Integration','Contact Forms'=>'Kontaktformulär','Edit Contact Form'=>'Redigera kontaktformulär','Contact'=>'Kontakt','Contact Form 7'=>'Contact Form 7']];